const supabase = Noodl.Variables.supabase;

if (!supabase) throw new Error('Supabase client not found');
const company = Inputs.Company
const inspector = Inputs.Inspector

try {
  const { data, error } = await supabase
                          .from('user_master')
                          .select()
                          .eq('company_id', company)
                          .gte('user_role', 6)
                          .neq('login_email', inspector);

  if (error) {
    console.error(error)
    Outputs.Failure();
  } else {
    const names = data.map(item => item.first_name);
    const emails = data.map(item => item.login_email);
    
    // Assigning the names to Outputs.Option
    Outputs.Option = emails;
    Outputs.Label = names;
    Outputs.All = data;
    Outputs.Success();
  }
} catch (error) {
    console.error(error)
  Outputs.Failure();
}

const supabase = Noodl.Variables.supabase;

if (!supabase) throw new Error('Supabase client not found');

const companyId = Inputs.companyId;
const ins = Inputs.Inpest
const userManagerDataList = [];

async function fetchUserDataByCompanyId(companyId) {
  try {
    const { data, error } = await supabase
      .from('user_master')
      .select('login_email, first_name')
      .eq('company_id', companyId)
      .gte('user_role', 6);

    if (error) {
      console.error(error);
      Outputs.Failure();
    } else {
      data.forEach((user) => {
        const userData = {
          Label: user.first_name || 'N/A',
          Value: user.login_email || 'N/A'
        };

        userManagerDataList.push(userData);
      });

      Outputs.Inspector = userManagerDataList;
      Outputs.Prim = ins
      console.log(userManagerDataList)
      Outputs.Success();
    }
  } catch (error) {
    console.error(error);
    Outputs.Failure();
  }
}

async function fetchDataForCompanyId() {
  await fetchUserDataByCompanyId(companyId);
  Outputs.close();
}

